                    p={1}
                >
                    <Box
                        sx={{
                            display: "flex",
                            flexWrap: "wrap",
                            "& > :not(style)": {
                                m: 1,
                                width: 128,
                                height: 128,
                            },
                        }}
                    >
                        <Paper elevation={0} />
                        <Paper />
                        <Paper elevation={3} />
                    </Box>
                </Grid>
            </Stack>
        </Box>
    );
}
